import React, { Component } from 'react';
import TodoApp from './components/todo/JJLZApp'
import './App.css';
import './bootstrap.css';

class App extends Component {
  render() {
    return (
      <div className="App">
         <TodoApp/>
      </div>
    );
  }
}

export default App;
